import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { TasksListsComponent } from './components/tasks-lists.component';
import { NewTasksComponent } from './new-tasks/new-tasks.component';

@NgModule({
  declarations: [
    TasksListsComponent,
    NewTasksComponent
  ],
  imports: [
    CommonModule
  ],
  exports: [
    TasksListsComponent
  ]
})
export class TasksModule { }
